import "./Posts.css"
import Post from "./Post";

export default function Posts({listOfPosts}){
    return(
        <div className="posts">

            {listOfPosts.map(post => {
                return(
                    <div>
                    <Post aSinglePost = {post}/>
                    </div>
                )
            })}
        </div>
    )
}
